        var treeTemplate=_.template(
            '<%_.each(data,function(val,key){%>' +
            '   <option value=""><%=val.name%></option>' +
            '   <%=val.childrenHtml%>' +
            '<%})%>'
        );
        var menu=_treeMenu.dataTransform(data,'parentId');
        var createTree=function(list,level){
            var html='';
            var jn=[];
            for(var i=0;i<level;i++){
                jn.push('--');
            }
            _.each(list,function(val,key){
                val.name=jn.join('')+val.name;
                if(val.children&&val.children.length){
                    val.childrenHtml=createTree(val.children,level+1);
                }
                html+=treeTemplate({data:[val]});
            });
            return html;
        };
        $('#s1').html(createTree(menu,0));
        console.timeEnd('tree');
    })();
